import Mock from 'mockjs';

//圖表數據
let List = []

export default {
    getStatisticalData: () => {
        console.log('Mock Data Requested');
        for (let i = 0; i < 7; i++) {
            List.push (
                Mock.mock({
                    蘋果: Mock.Random.float(100, 8000, 0, 0),
                    vivo: Mock.Random.float(100, 8000, 0, 0),
                    oppo: Mock.Random.float(100, 8000, 0, 0),
                    魅族: Mock.Random.float(100, 8000, 0, 0),
                    三星: Mock.Random.float(100, 8000, 0, 0),
                    小米: Mock.Random.float(100, 8000, 0, 0),
                })
            )
        }
        return {
            code: 20000, //狀態碼
            data: {
                //圓餅圖
                videoData: [
                    {
                        name: '小米',
                        value: 2999
                    },
                    {
                        name: '蘋果',
                        value: 5999
                    },
                    {
                        name: 'vivo',
                        value: 1500
                    },
                    {
                        name: 'oppo',
                        value: 1999
                    },
                    {
                        name: '魅族',
                        value: 2200
